        "from sklearn.compose import ColumnTransformer\n",
        "from sklearn.pipeline import Pipeline\n",
        "\n",
        "if len(filtered_bnb) > 0:\n",
        "    # Features for prediction\n",
        "    feature_cols = [\"neighbourhood_group\", \"room_type\", \"minimum_nights\",\n",
