        "    data = filtered_bnb[feature_cols + [\"price\"]].dropna()\n",
        "\n",
        "    X = data[feature_cols]\n",
        "    y = data[\"price\"]\n",
        "\n",
        "    # Cap price at some upper limit to reduce extreme outliers\n",
        "    y = np.where(y > 1000, 1000, y)\n",
